@-moz-document domain(sonicrainboom.com.br) {
body{

 background-image: url(http://sonicrainboom.com.br/images/dev/icons/titles/mod.png) !important; }
.header_image { background-image: url(http://sonicrainboom.com.br/images/dev/icons/titles/mod.png) !important; }
.thead {
 margin: 0px;
