background-color: #333745;
 color: #FCFCFC;
 text-align: center;
 line-height: 1.4;
 font-family: Verdana, Arial, Sans-Serif;
 font-size: 13px;
}
.menu ul a:link {
  color: #BD3E2E;
  text-decoration: none;
  background-color: rgba(0, 0, 0, 0.75);
  display: block;
  float: left;
  padding-bottom: 8px;
  padding-top: 8px;
