}
.tcat {
  background: #D94A4A;
  color: #fff;
  font-size: 12px;
    background-image: url(http://sonicrainboom.com.br/images/dev/icons/titles/mod.png)
}
img.logo_image {
 -webkit-filter: hue-rotate(35deg) saturate(1.3);
    background-image: url(http://sonicrainboom.com.br/images/dev/icons/titles/mod.png)
}
#header_wrapper {
    
  height: 281px;
  width: 1012px;
  background-color: #DA1C1C;
  margin-left: auto;
  margin-right: auto;
  padding-top: 5px;
  position: relative;
    background-image: url(http://sonicrainboom.com.br/images/dev/icons/titles/mod.png)
}
a:visited {
  color: #FF0000;
  text-decoration: none;
}
a:link {
  color: #FF0000;
